import React from 'react';

const Gallery = () => {
  const images = Object.values(localStorage).filter(item => typeof item === 'string');

  return (
    <div className="Gallery">
      {images.map((image, index) => (
        <img key={index} src={image} alt={`Image ${index}`} />
      ))}
    </div>
  );
};

export default Gallery;
